import React from "react";
import styled from "styled-components";
import {media} from "../../01 Atoms/MediaQueries";
import ResponsiveImage from "../../01 Atoms/ResponsiveImage";
import TestImg from "../../../media/img/Projects/03_Photo Retoucher/EATBRUSSELS2019/EatDeco.png"


const PhotoProjectHeader = () => {
    return <>
        <Wrapper>
            <ResponsiveImage
                sourceDesktop={TestImg}
                sourceMobile={TestImg}
            />
        </Wrapper>

    </>

};

export default PhotoProjectHeader;

export const Wrapper = styled.div`
width: 100%;
height: 120px;
background-color: red;

${media.tablet`
height: 136px;
`}

${media.desktop`
height: 200px;
`}

& img {
height: 100%;
}

`;
